import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './OneBox.css';

function OneBox() {
  const [view, setView] = useState('inbox');
  const [threads, setThreads] = useState([]);
  const [selectedThread, setSelectedThread] = useState(null);
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch all threads
  const fetchThreads = async () => {
    setLoading(true);
    try {
      const response = await axios.get('https://hiring.reachinbox.xyz/api/v1/onebox/list');
      setThreads(response.data.data);
    } catch (error) {
      console.error('Error fetching threads:', error);
    } finally {
      setLoading(false);
    }
  };

  // Fetch messages from a thread
  const fetchMessages = async (threadId) => {
    setLoading(true);
    try {
      const response = await axios.get(`https://hiring.reachinbox.xyz/api/v1/onebox/messages/${threadId}`);
      setMessages(response.data.data);
      setSelectedThread(threadId);
      setView('thread');
    } catch (error) {
      console.error('Error fetching messages:', error);
    } finally {
      setLoading(false);
    }
  };

  // Delete a thread
  const deleteThread = async (threadId) => {
    try {
      await axios.delete(`https://hiring.reachinbox.xyz/api/v1/onebox/messages/${threadId}`);
      alert('Thread deleted');
      fetchThreads();
    } catch (error) {
      console.error('Error deleting thread:', error);
    }
  };

  // Reset all data
  const resetData = async () => {
    try {
      await axios.post('https://hiring.reachinbox.xyz/api/v1/onebox/reset');
      alert('Data reset');
      fetchThreads();
    } catch (error) {
      console.error('Error resetting data:', error);
    }
  };

  useEffect(() => {
    fetchThreads();
  }, []);

  return (
    <div className="onebox-container">
      <Sidebar setView={setView} resetData={resetData} />
      <div className="main-content">
        <Header />
        <div className="content-area">
          {loading && <p>Loading...</p>}

          {!loading && view === 'inbox' && (
            <>
              <h2>Email Threads</h2>
              {threads.length === 0 ? (
                <p>No threads found.</p>
              ) : (
                <ul className="thread-list">
                  {threads.map((thread) => (
                    <li key={thread.id} className="thread-item">
                      <span onClick={() => fetchMessages(thread.id)}>{thread.subject}</span>
                      <button onClick={() => deleteThread(thread.id)}>Delete</button>
                    </li>
                  ))}
                </ul>
              )}
            </>
          )}

          {!loading && view === 'thread' && (
            <>
              <h2>Messages in Thread</h2>
              <button onClick={() => setView('inbox')}>Back to Threads</button>
              <ul className="message-list">
                {messages.map((msg, idx) => (
                  <li key={idx}>
                    <strong>{msg.from}</strong>: {msg.body}
                  </li>
                ))}
              </ul>
            </>
          )}
        </div>
      </div>
    </div>
  );
}

function Sidebar({ setView, resetData }) {
  return (
    <div className="sidebar">
      <ul>
        <li onClick={() => setView('inbox')}>Inbox</li>
        <li onClick={resetData}>Reset</li>
      </ul>
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <h1>OneBox Dashboard</h1>
    </div>
  );
}

export default OneBox;
